import { createApp } from 'vue'
import App from './App.vue'
import './index.css'
import anime from 'animejs/lib/anime.es.js';

createApp(App).mount('#app')

/* ANIMATIONS */

let title = anime.timeline({
    targets: '.text-title'
});

let categoryItem = anime.timeline({
    targets: '.item-category'
})

title.add({
    scale: 1,
    duration: 700
})

categoryItem.add({
    scale: 1,
    duration: 1700
})
